import React from 'react';
import Article from './A.js';


const AList = ({ As }) => {

	if (As.length === 0) {
		return (<p>Loading...</p>)
	}

	const AsNodes = As.map((A, index) => {
		return (
			<li key={index} className="component-item">
				<div className="component">
					<A A={A} />
				</div>
			</li>
		)
	})

	return (
		<ul className="component-list">
			{AsNodes}
		</ul>
	)
}
export default AList;
